import React, { Component } from "react";
import "./App.css";
import NavBar from "./component/NavBar";
import { Grid } from "@material-ui/core";
const App = () => {
  return (
    <Grid container direction="column">
      <NavBar />
      <Grid item> this is where the Header</Grid>
      <Grid item> this is where the content</Grid>
    </Grid>
  );
};

export default App;
